import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEdit } from "@fortawesome/free-solid-svg-icons";
import { Link } from "react-router-dom";
import "./CategoryListStyle.css";

const CategoryList = ({ categories }) => {
  return (
    <>
      <h2 className="category_list_title">Моите категории</h2>
      <table className="category">
        <thead>
          <tr>
            <th>Id</th>
            <th>Title</th>
            <th>Options</th>
          </tr>
        </thead>
        <tbody>
          {categories.map((category, index) => {
            return (
              <tr style={{ fontSize: 20, padding: 15 }} key={index}>
                <td> {category.id}</td>
                <td>{category.name}</td>
                <td>
                  <Link to={`/my_profile/recipes/category/${category.id}`}>
                    <FontAwesomeIcon className="edit" icon={faEdit} />{" "}
                  </Link>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </>
  );
};

export default CategoryList;
